Добавляет из XLSX файла полные ФИО и номер полиса в кэш.
Требование к XLSX файлу: 
данные расположены на первом листе;
1 столбец - номер полиса;
2 столбец - полные ФИО пациента;
Заголовки столбцов не требуются, лишние пробелы, регистр букв 
и одинаковые пациенты обрабатываются автоматически.

